import { useEffect, useState } from 'react'

const Home = () => {
    const [users, setUsers] = useState(null)
    useEffect(() => {
        const fetchUsers = async () => {
            const res = await fetch('hhtp://localhost:4000/api/users')
            const json = await res.json()

            if (res.ok) setUsers(json)
        }

        fetchUsers()
    }, [])

    return(
        <div className="Home">
            <div className='users'>
                {users && users.map((user) => {
                    <p key={user._id}>{user.email}</p>
                })}
            </div>
        </div>
    )
}

export default Home
